import React from 'react'
import styled from '@emotion/styled'

const WelcomeText = styled.h2({
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',

    '& h2': {
        margin: '0.5rem',
    },

})

const SearchBar = styled.div({
    position: 'relative',
    display: 'inline-block',
    width: '40vw',
})

const SearchBarInput = styled.input({
    width: '100%',
    padding: '0.5rem',
    border: '1px solid #ccc',
    borderRadius: '0.35rem',
    fontSize: '1rem',
})

const SearchIcon = styled.p({
    position: 'absolute',
    right: '0.5rem',
})

const Search = () => {
    return (
        <>
            <WelcomeText>
                <h2>Hello, Dani</h2>
                <h3>Just a quick check in</h3>
            </WelcomeText>

            <SearchBar>
                <SearchBarInput type='text' placeholder='We are in great shape with intake!'>
                </SearchBarInput>
                <SearchIcon>S</SearchIcon>
            </SearchBar>
        </>
    )
}

export default Search
